window.bookSummaryJSON = "Returning to the vivid universe of Frank Herbert's <i>Dune</i>, this title continues the saga begun in <i>Dune: House Atreides</i>. <p>As Shaddam sits at last on the Golden Lion Throne, Baron Vladimir Harkonnen plots against the new Emperor and House Atreides - and against the mysterious Sisterhood of the Bene Gesserit. For Leto Atreides, grown complacent and comfortable as ruler of his House, it is a time of momentous choice: between friendship and duty, safety and destiny. But for the survival of House Atreides, there is just one choice: strive for greatness or be crushed.</p>"; 
